import React from "react"
import { Routes, Route, Link } from 'react-router-dom';
import Home from './components/Home';
import Toys from './components/Toys';
import ForKids from './components/ForKids';
import AboutUs from './components/AboutUs';
import Singin from './components/Singin';
import Blog from './components/Blog';
import logo from './img/oina.png';

function Header() {
  return (
    <>
    <section id ="container">
      <div className='navbar'>
      <img src={logo} class="logo"></img>
          <ul>
            <li><Link to="/Home">Главная</Link></li>
            <li><Link to="/Toys">Игрушки</Link></li>
            <li><Link to="/ForKids">Для детей</Link></li>
            <li><Link to="/AboutUs">О нас</Link></li>
            <li><Link to="/Blog">Блог</Link></li>
          </ul>
          <ul>
            <li><Link to="/Blog">Войти</Link></li>
          </ul>
      </div>
      </section>
      <Routes>
        <Route path="/Home" element={<Home />} />
        <Route path="/Toys" element={<Toys />} />
        <Route path="/ForKids" element={<ForKids />} />
        <Route path="/AboutUs" element={<AboutUs />} />
        <Route path="/Blog" element={<Blog />} />
      </Routes>
    </>
  );
}

export default Header;
